description:
Nar tjejtjusaren Henry Roth traffar Lucy uppstar karlek vid 
forsta ogonkastet. Men nar de traffas igen nasta dag har hon 
ingen aning om vem han ar. Lucy har namligen extremt kort 
narminne. For att Henry ska vinna henne maste han fa henne 
att bli kar i honom om och om igen - varje dag. 

Med Adam Sandler, Drew Barrymore, Rob Schneider m fl. 

Filmen har inbrand svensk text.
